import React, { Component } from "react";

export default class Ninth extends Component {
  render() {
    return (
      <section id="ninth">
        {" "}
        <div className="columns contact-details">
          <h2>Try USEIAM Today</h2>{" "}
          <div class="flex social-btns">
            <a class="app-btn blu flex vert" href="http:apple.com">
              <img src="images/appstore.png" alt="appstore" />
            </a>
            <a class="app-btn blu flex vert" href="http:google.com">
              <img src="images/googleplay.png" alt="googlestore" />{" "}
            </a>
          </div>
        </div>
      </section>
    );
  }
}
